  false,\n\t\"url\": null,\n\t\"notes\": \"Hourly measurements made by selected ship
  sensors on the R/V Atlantis during the \"Mountains in the Sea 2003\" expedition
  sponsored by the National Oceanic and Atmospheric Administration (NOAA) Office of
  Ocean Exploration, July 11 through July 19, 2003. Measurements include ship's position
  and heading, air temperature, relative humidity, barometric pressure, wind speed
  and direction, sea surface temperature, and salinity. This data set was compiled
  from Athena Data Handling System ASCII files provided by the Woods Hole Oceanographic
  Institution.\",\n\t\"owner_org\": \"9cda5205-d632-4814-96e7-a4ab5e0dce85\",\n\t\"extras\":
